import logo from './logo.svg';
import './App.css';
import FavoriteButton from './fav-button/FavoriteButton';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         connect favorite_button to this
         <FavoriteButton shape="circle" size="large" color="red"/>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
